    padding: 0 5% 2% 5%
    display: flex;
    flex-flow: row wrap;

`;
const Column = styled.div`
    padding: 0;
    width: 45%;
    height: 100%;
`;
const Title = styled.div`
    text-align: left;
    font-family: Times New Roman, serif;
    font-size: 30px;
    color: #000002;
    font-weight: lighter;
    margin: 0;
`;
