                       return <Paragraph>Hello</Paragraph>
                    })
                }
            })
            }
            </Column>
        <Column>
            <Title>Team</Title>
            {/*{props.team.members.map((t, index)=>{*/}
            {/*  return  <Paragraph>{t}</Paragraph>*/}
            {/*})}*/}
             <p>{props.team.role}</p>
            {getStuff(props.team.members)}
            {upHere}
            <p>{props.team.members}</p>
        </Column>
    </Wrapper>
)

export default Team;
